import React from 'react';
import './contact.scss';
import '../../css/mediaqueries.scss';
import { Form, Button } from 'react-bootstrap';

export default function Contact() {


    function sendMessage() {

    }

    return (
        <div className="w-100 d-flex flex-column align-items-center">
            <Form className="p-5 media-width d-flex flex-column align-items-center">
                <Form.Group className="media-width" controlId="formName">
                    <Form.Label>Name</Form.Label>
                    <Form.Control type="text" />
                </Form.Group>
                <Form.Group className="media-width" controlId="formEmail">
                    <Form.Label>E-mail</Form.Label>
                    <Form.Control type="e-mail" />
                </Form.Group>
                <Form.Group className="media-width" controlId="formMessage">
                    <Form.Label>Message</Form.Label>
                    <Form.Control as="textarea" rows={3} />
                </Form.Group>
                <Button variant="secondary" onClick={() => sendMessage()}>
                    Submit
                 </Button>
            </Form>
        </div>
    );
}
